import 'animate.css'
import React from "react";
import loadingPic from './bg.png'
const LandingPage = () => {
  return (
  <main className=' items-center justify-center justify-items-center align-middle'>
    <div className=''>
    <img src={loadingPic} className=' self-center m-0 p-0' />
    </div>
  </main>
  );
};



export default LandingPage;
